base_complements = {"A": "T", "T": "A", "G": "C", "C": "G"}


def find_reverse_complement(input: str) -> str:
    reversed_input = reversed(input)

    complement = ""
    for c in reversed_input:
        complement += base_complements[c]

    return complement


if __name__ == "__main__":
    print(
        find_reverse_complement(
            ""
        )
    )
